import { useState, useEffect } from 'react'


function useStats() {
  const [stats, setStats] = useState();
  useEffect(() => {
    async function fetchData() {
      console.log('Fetching Data');
      const data = await fetch('https://covid19.mathdro.id/api/')
        .then(data => data.json());
        setStats()
    }
    fetchData();
  }, [])
}

function Stats() {
  const stats = useStats();
  console.log(stats)
